Agnetha: Abba and After

Arts Documentary hosted by Kirsty Young, published by BBC in 2013 - English narration


Information
------------------------------

In this documentary the BBC have exclusive access to Agnetha FÃƒÂ¤ltskog, 'The Girl with the Golden Hair' as the song goes, celebrating her extraordinary singing career which began in the mid-60s when she was just 15. Within just two years, she was a singing sensation at the top of the charts in Sweden.
Along came husband BjÃƒÂ¶rn Ulvaeus and the phenomenal band Abba that engulfed the world in the 70s, featuring Agnetha's touching voice and striking looks. Agnetha lacked confidence on stage as the global demand for the group grew and grew, while being away from her young children caused her great turmoil.
With special behind-the-scenes access to the making of her comeback album, the film follows this reluctant star - the subject of much tabloid speculation since she retreated from the stage post-Abba - as she returns to recording aged 63. Included in the film is her first meeting with Gary Barlow, who contributes a duet to the new album.
